VALUES ('5999100000049', 'Bcaa glutamine express', 'Leucine, Isoleucine and Valine belong to the family of protein buifflng Branched-Chain Amino Acids (BCAAs), They are among the 9 essential aminos for humans, because our bodies can\'t manufacture thern,sothü only source is our daily food or food supplementation. BCAAs accountfor 35% of the essential amino acids in muscle proteins, On the Otherhand, Glutamine is a top ingredient for athletes in popularity, so we includeditb boost Glutamine intake levels. As a plus, BCAA+GLUTAMINE XPRESS is fortified With Taurine as well! The 1:1 combination of high dose BCAAsand Glutamine in this scientifically formulated powder promotes musde recovery during and after high-intensity workout preventing undesirable muscle breakdown. BCAA+GLUTAMINE XPRESS provides these crucial aminos in exceptionally delicious flavors! Allergen info: Manufactured in a facility that processes milk, egg, gluten, soy, peanuts, nuts, celery, fish and crustacean ingredients. Warnings: Keep out of the reach of children! Don\'t exceed the recommended daily dosage! Use this product in conjunction With foodas part of a healthy, balanced diet, not as a substitute for such. 0,31. Storage conditions: Store in a cool, dry place. Heat and sunlight may damage the bottle! Best before end: see on packaging. (MM/YYYY) Batch number: see on packaging.', 'https://static.openfoodfacts.org/images/products/599/910/000/0049/front_fr.4.400.jpg', '0', '0', '0', '0', '0', '1', '0', '0', '', '1');

